	('f0d81471-45e7-4698-892d-eed434d6a42a', 'dd6ad0c0-d95a-436d-ba38-20208663db6c', 'f3d6b62b-d92b-443a-9385-7583afe50c2b', 'Hey there! ðŸŒŸ How''s your fitness journey shaping up this week? I''m here to cheer you on whether it''s crushing workouts or navigating busy workdays. Balancing self-care and responsibilities can be a dance, but you''re rocking it! Remember, progress isn''t always linear, but every step counts. Share any wins, challenges, or even those gardening experiments you''ve been diving into! Let''s keep your fitness journey as vibrant and rewarding as the rest of your awesome life. Feel free to chat about anything on your mind! ðŸ’ªðŸŒ±ðŸ‹ï¸â€â™‚ï¸', NULL, NULL, NULL, NULL, '2025-06-29 17:49:23.883569+00', 'text', '2025-06-29 17:49:23.883569+00', false, NULL, true, 'fitness_newbie', '{"has_memory": false, "human_message": "Generate a friendly check-in message asking how the user''s fitness journey is going. Be genuinely interested and offer support if needed. Keep it casual and caring.", "relationship_stage": "new_connection", "conversation_length": 8, "response_validation": {"is_valid": true, "used_fallback": false, "validation_issues": []}}'),
	('117446e8-b1bd-454e-88ef-ac1a5bf84f59', 'dd6ad0c0-d95a-436d-ba38-20208663db6c', '11111111-1111-1111-1111-111111111111', 'Hey there! ðŸŒŸ How''s your fitness journey unfolding? I''m genuinely interested in hearing about your progress and adventures in the world of health and wellness! Balancing fitness goals with everyday life can be a fun challenge. If you ever need tips on staying motivated or finding budget-friendly workout options, I''m here to brainstorm with you. Remember, consistency is key! So, how''s everything else going in your world? Any exciting updates or plans on the horizon? Let''s catch up! ðŸ˜ŠðŸ’ª', NULL, NULL, NULL, NULL, '2025-06-29 17:49:34.756807+00', 'text', '2025-06-29 17:49:34.756807+00', false, NULL, true, 'fitness_newbie', '{"has_memory": false, "human_message": "Generate a friendly check-in message asking how the user''s fitness journey is going. Be genuinely interested and offer support if needed. Keep it casual and caring.", "relationship_stage": "new_connection", "conversation_length": 8, "response_validation": {"is_valid": true, "used_fallback": false, "validation_issues": []}}');


